type FourProperty struct {
	Image string  `json:"image"`
	Class string  `json:"class"`
	Style string  `json:"style"`
	Pos   float64 `json:"pos"`
	Num   int     `json:"num"`
}

type Properties []*FourProperty

func (p Properties) Len() int           { return len(p) }
func (p Properties) Less(i, j int) bool { return p[i].Pos < p[j].Pos }
func (p Properties) Swap(i, j int)      { p[i], p[j] = p[j], p[i] }

func PosToInt(pos float64) int {
	switch pos {
	case -34.5:
		return -3
	case -23:
		return -2
	case -11.5:
		return -1
	case 0:
		return 0
	case 11.5:
		return 1
	case 23:
		return 2
	case 34.5:
		return 3
	}
	return 0
}

func (p Properties) ToInt() int {
	length := len(p)
	arr := make([]int, 0, length)
	for i, property := range p {
		pos := i + PosToInt(property.Pos)
		arr = append(arr, pos)
	}
	num := 0
	for i := 0; i < length; i++ {
		num += sum(length-arr[i]-1, p[i].Num)
	}
	return num
}

func sum(i, num int) int {
	for j := 0; j < i; j++ {
		num = num * 10
	}
	return num
}

