func FourRequest(url string) (*FourResult, error) {
	cookie := "sessionid=x7sm5ysum5xbr03gj442c7c248vwcldt"
	req, err := Get(url, cookie)
	if err != nil {
		return nil, err
	}
	req.Header.Set("User-Agent", "yuanrenxue.project")
	client := http.Client{}
	res, err := client.Do(req)
	if err != nil {
		return nil, err
	}
	defer res.Body.Close()
	b, err := ioutil.ReadAll(res.Body)
	if err != nil {
		return nil, err
	}
	result := &FourResult{}
	if err = json.Unmarshal(b, result); err != nil {
		return nil, err
	}
	return result, nil
}

