func toMd5(s string) (string, error) {
	encode := Encode(s)
	encode = strings.ReplaceAll(encode, "=", "")
	fmt.Println(encode)
	return CallJs("./4.js", "hex_md5", encode)
}

func GetProperties(info string) []Properties {
	propertiess := make([]Properties, 0)
	arr := strings.Split(info, "</td>")
	for _, a := range arr {
		properties := getProperties(a)
		if len(a) != 0 {
			propertiess = append(propertiess, properties)
		}
	}
	return propertiess
}

func getProperties(info string) Properties {
	arr := strings.Split(info, "base64,")
	valid := Properties{}
	for _, a := range arr {
		if strings.HasPrefix(a, "iVBO") {
			property := &FourProperty{}
			sss := strings.Split(a, `" class="img_number `)
			if len(sss) > 1 {
				property.Image = sss[0]
				yyy := strings.Split(sss[1], `" style="left:`)
				if len(yyy) > 1 {
					property.Class = yyy[0]
					ddd := strings.Split(yyy[1], `px`)
					if len(ddd) > 1 {
						f, _ := strconv.ParseFloat(ddd[0], 64)
						property.Style = ddd[0]
						property.Pos = f
						property.Num = ImageMap[property.Image]
						valid = append(valid, property)
					}
				}
			}
		}
	}
	return valid
}

func GetValidProperties(propertyClass string, properties []Properties) []Properties {
	valid := make([]Properties, 0)
	for _, property := range properties {
		v := Properties{}
		for _, p := range property {
			if p.Class == propertyClass {
				v = append(v, p)
			}
		}
		if len(v) != 0 {
			valid = append(valid, v)
		}
	}
	return valid
}

func GetNotValidProperties(propertyClass string, properties []Properties) []Properties {
	valid := make([]Properties, 0)
	for _, property := range properties {
		v := Properties{}
		for _, p := range property {
			if p.Class != propertyClass {
				v = append(v, p)
			}
		}
		if len(v) != 0 {
			valid = append(valid, v)
		}
	}
	return valid
}

